To functions from the chain extension in your smart contract, register the chain extension: #[ink::chain_extension]
pub trait Iris { type ErrorCode = IrisErr; #[ink(extension = 0, returns_result = false)] fn transfer_asset( contract_account: ink_env::AccountId, consumer_account: ink_env::AccountId, asset_id: u32, asset_quantity: u64 ) -> [u8; 32]; #[ink(extension = 1, returns_result = false)] fn mint(caller: ink_env::AccountId, target: ink_env::AccountId, asset_id: u32, amount: u64) -> [u8; 32]; #[ink(extension = 2, returns_result = false)] fn lock(amount: u64) -> [u8; 32]; #[ink(extension = 3, returns_result = false)] fn unlock_and_transfer(target: ink_env::AccountId) -> [u8; 32];
} and invoke the chain extension function: self.env() .extension() .mint( caller, self.env().account_id(), asset_id, amount, ).map_err(|_| {}).ok();
